import "./App.css";
import Home from "./pages/views/Home";
import styled from "styled-components";
import {
  BrowserRouter as Router,
  Route,
  Switch,
} from "react-router-dom";

const Container = styled.div`
  width: 100vw;
  height: 100vh;
`;

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" component={Home}></Route>
        {/* <Route path="/"></Route> */}
      </Switch>
    </Router>
  );
}

export default App;
